    return (
        <div>
            <div className="TopNavigationBar">
                <div className='logo'>
                    <img src="logo.png"  />
                </div>

                <div className="user">
                    <Link to="/">通知</Link>
                    <Link to="/about">账户</Link>
                    <Link to="/contact">设置</Link>
                </div>
            </div>


            <Outlet />
        </div>

        
    )
}

export default TopNavigationBar
